import React from "react";
import "./pics.css";
import Cards, { Card } from "react-bootstrap";
import CardItem from "./CardItem";
export default function Picture() {
  var i = 0;
  var par = [];
  var time = 3000;

  par[0] = document.getElementById("mySlides0");
  par[1] = document.getElementById("mySlides1");
  par[2] = document.getElementById("mySlides2");

  function changePar(){
    document.slide.src = par[i]; 
    if(i<par.length -1){
      i++;
    }else{
      i=0;
    }
    setTimeout("changePar()", time);
  }
  window.onload = changePar;
  return (
    <>
      <div className="picsHolder">
        <div id="disc">

<div class="slideshow-container">

  <div class="mySlides fade">
    <div class="numbertext">1 / 3</div>
    <img src="img1.jpg" style="width:100%"/>
    <div class="text">Caption Text</div>
  </div>

  <div class="mySlides fade">
    <div class="numbertext">2 / 3</div>
    <img src="img2.jpg" style="width:100%"/>
    <div class="text">Caption Two</div>
  </div>

  <div class="mySlides fade">
    <div class="numbertext">3 / 3</div>
    <img src="img3.jpg" style="width:100%"/>
    <div class="text">Caption Three</div>
  </div>

  <a class="prev" onclick="plusSlides(-1)">&#10094;</a>
  <a class="next" onclick="plusSlides(1)">&#10095;</a>
</div>
<br/>

<div style="text-align:center">
  <span class="dot" onclick="currentSlide(1)"></span>
  <span class="dot" onclick="currentSlide(2)"></span>
  <span class="dot" onclick="currentSlide(3)"></span>
</div> 
        </div>

        <div id="picEdit">
          <ul className="image">
            <img src="images/IMG_2207.jpeg" />
          </ul>
        </div>
      </div>
    </>

    // <div className="picHolder">
    //   <div className="image">

    //   </div>
    //   <div className="discr">{/* <h1>Software/Web Deverloper</h1> */}</div>
    // </div>
  );

}
